I'm not sure if this is exactly what you're looking for, but I've created a simple class that can be used to stack multiple images on top of each other.

```
class StackedImages {
    private var images: [UIImage] = []
    private var imageViews: [UIImageView] = []

    init(images: [UIImage]) {
        self.images = images
        for image in images {
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageViews.append(imageView)
        }
    }

    func stackImages(on view: UIView) {
        for (index, imageView) in imageViews.enumerated() {
            let x = CGFloat(index) * imageView.frame.width
            imageView.frame = CGRect(x: x, y: 0, width: imageView.frame.width, height: imageView.frame.height)
            view.addSubview(imageView)
        }
    }
}
```

To use this class, you can create an instance of it with an array of images, and then call the `stackImages(on:)` method to add the images to a view.

```
let images = [UIImage(named: "image1"), UIImage(named: "image2"), UIImage(named: "image3")]
let stackedImages = StackedImages(images: images)
stackedImages.stackImages(on: view)
```

This will stack the images on top of each other in the view, with the first image at the bottom and the last image at the top.

Note that this class assumes that all of the images have the same size. If you need to support images with different sizes, you may need to modify the class to handle that.

